import Layout from "../components/layout";

const Blog = ({ posts }) => (
  <Layout>
    <article id="blog-container">
      {posts.map(post => (
        <h1>post</h1>
      ))}
    </article>
  </Layout>
);

Blog.getInitialProps = ({ req }) => {
  const samplePosts = ["blog1", "blog2", "blog3"];

  return { posts: samplePosts };
};

export default Blog;
